import colorStyle from './ColorsContainer.module.css';

function ColorsContainer() {

    return (
        <div className={colorStyle.mainContainer}>
            <div className={colorStyle.upperRow}>
                <button className="colorStyle.btn1" onClick={myHandler} >1</button>
                <button className="colorStyle.btn2" onClick={myHandler} >2</button>
                <button className="colorStyle.btn3" onClick={myHandler} >3</button>
            </div>
            <div className={colorStyle.lowerRow}>
                <button className="colorStyle.btn4" onClick={myHandler} >4</button>
                <button className="colorStyle.btn5" onClick={myHandler} >5</button>
                <button className="colorStyle.btn6" onClick={myHandler} >6</button>
            </div>
        </div>
    );
}

export default ColorsContainer;
